// src/components/GameCard.js
import React from 'react';
import { Link } from 'react-router-dom';

const GameCard = ({ gameName, imageUrl, linkTo }) => {
  return (
    <div>
      <img src={imageUrl} alt={`${gameName} Cover`} />
      <h3>{gameName}</h3>
      <Link to={linkTo}>Beli Sekarang</Link>
    </div>
  );
};

export default GameCard;
